  const [value, setValue] = useState("");
  const onChange = (e:React.FormEvent<HTMLInputElement>) => {
    const { 
      currentTarget:{value} 
  } = e;
  setValue(value);
  };
  return (
    <div>
      <form>
        <input
          value={value}
          onChange={onChange}
          type="text"
          placeholder="username"
        />
        <button>Log in</button>
      </form>
    </div>
  );
}

